import React from "react";
import "./recent-songs.css";
import SongComp from "../songComp/SongComp";

function RecentSongs() {
  return (
    <div className="recent-songs-container">
      <div className="songs-container">
        <SongComp imgPath="song-1.jpg" />
        <SongComp imgPath="song-2.jpg" />
      </div>

      <button className="all-blogs-button">See All Blog Posts</button>
    </div>
  );
}

export default RecentSongs;
